import React, { useState, useRef, useLayoutEffect } from 'react';

function RowItem({ item, isOpen, onToggle, activeTab, onComplete, onPostpone }) {
  const [ripples, setRipples] = useState([]);
  const wrapRef = useRef(null);
  const [maxH, setMaxH] = useState(0);

  useLayoutEffect(() => {
    if (wrapRef.current) {
      const h = wrapRef.current.scrollHeight || 0;
      setMaxH(isOpen ? h : 0);
    }
  }, [isOpen, item]);

  function ripple(e) {
    const rect = e.currentTarget.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;
    const id = Date.now() + Math.random();
    setRipples(r => [...r, { id, x, y }]);
    setTimeout(() => setRipples(r => r.filter(i => i.id !== id)), 600);
  }

  return (
    <div className="row-wrap">
      <div className={`row ${isOpen ? 'is-open' : ''}`} onMouseDown={ripple} onClick={() => onToggle(item.planningid)}>
        {ripples.map(r => <span key={r.id} className="ripple" style={{ left: r.x, top: r.y }} />)}

        <div className="cell cell-project">
          <div className="title-project">{item.projectname}</div>
        </div>

        <div className="cell cell-account">
          <div className="text-account">{item.accountname}</div>
        </div>

        <div className="cell cell-meta">
          {activeTab === 'complete'
            ? <span className="badge-success">Success</span>
            : <span className="date-text">{item.dateStart || '-'}</span>}
        </div>
      </div>

      <div className={`detail-anim ${isOpen ? 'open' : ''}`} style={{ maxHeight: isOpen ? maxH + 'px' : 0 }}>
        <div className="detail" ref={wrapRef} onClick={(e) => e.stopPropagation()}>
          <div className="detail-box">
            <div className="stack">
              <div className="kv"><b>Engineer:</b> {item.engineer || '-'}</div>
              <div className="kv"><b>Start Date:</b> {item.dateStart || '-'}</div>
              <div className="kv"><b>End Date:</b> {item.dateEnd || '-'}</div>
              <div className="kv"><b>Time Start:</b> {item.timeStart || '-'}</div>
              <div className="kv"><b>Time End:</b> {item.timeEnd || '-'}</div>
              {activeTab === 'complete' && <div className="kv"><b>Complete Date:</b> {item.dateSuccess || '-'}</div>}
            </div>

            {activeTab === 'pending' && (
              <div className="btns">
                <button className="btn btn-success" onClick={() => onComplete(item.planningid)}>Complete</button>
                <button className="btn btn-warn" onClick={() => onPostpone(item.planningid)}>Postpone</button>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default RowItem;
